    false,nt"url": null,nt"notes": "Moist soil impoundment (MSI) construction
    at Duck River unit was completed in 1985 and water management was initiated. Permanent
    transects were established within the MSI's to record vegetation composition/quality,
    analyze vegetation composition/quality and provide recommendations for the production
    of quality waterfowl foods, and record plant responses to various management techniques.
    The transects are to be surveyed annually. A herbarium has been established to aid
    in the identification of plants. Methods used and an analysis of each MSI is included.
    A description of use of the five-point vegetation sampler is given.",nt"owner_org":
